    .content {
      box-sizing: border-box;
      display: block;
      Margin: 0 auto;
      font-family: Raleway;
    }

    .main {
      border-radius: 3px;
      width: 100%;
    }

    .header {
      padding: 20px 0;
    }

    .footer {
      clear: both;
      Margin-top: 70px;
      text-align: center;
      width: 100%;
      padding: 0px 30px;
    }

    .footer td,
    .footer p,
    .footer span,
    .footer a {
      color: #1A1A1A;
      font-size: 13px;
      text-align: center;
    }

    h1,
    h2,
    h3,
    h4 {
      color: #06090f;
      font-family: sans-serif;
      font-weight: 400;
      line-height: 1.4;
      margin: 0;
      margin-bottom: 30px;
    }

    h1 {
      font-size: 35px;
      font-weight: 300;
      text-align: center;
      text-transform: capitalize;
    }

    p,
    ul,
    ol {
      font-family: sans-serif;
      font-size: 14px;
      font-weight: normal;
      margin: 0;
      margin-bottom: 15px;
    }

    p li,
    ul li,
    ol li {
      list-style-position: inside;
      margin-left: 5px;
    }

    a {
      text-decoration: underline;
    }
   
    .align-center {
      text-align: center;
    }

    .title {
      text-align: center;
      font-weight: 700;
      font-family: sans-serif;
      font-weight: 600;
      font-size: xx-large;
      color: black;
    }

    .sub-title {
      text-align: center;
      font-family: sans-serif;
      color: black;
      font-size:medium;
    }

    .border {
      border: 1px solid black;
    }

    .code tbody tr td {
      font-size: 35px;
      font-weight: 600;
      color: #CBA50A;
      padding: 20px 20px;
    }
    .note tbody tr td {
      font-size: 12px;
      font-weight: 600;
      color: #484848;
      padding: 20px 20px;
    }
  </style>
</head>
